query:
UPDATE taskTemplates 
SET uniqueId = CONCAT('OT-', LPAD(id, 3, '0'), '-V1')
WHERE uniqueId IS NULL OR uniqueId LIKE 'SP-%' OR uniqueId NOT LIKE 'OT-%';

